//import EventIcon from "@material-ui/icons/Tsunami";
//import AsteroidIcon from "@material-ui/icons/Flare";

// Import the circular menu
import {
    CircleMenu,
    CircleMenuItem,
    TooltipPlacement,
} from "react-circular-menu";
import React from "react";

class CirclesMenu extends React.Component {

    render = () => {
        const CircleMarkup = (
            <CircleMenu
                startAngle={0}
                rotationAngle={90}
                itemSize={2}
                radius={5}
                /**
                 * rotationAngleInclusive (default true)
                 * Whether to include the ending angle in rotation because an
                 * item at 360deg is the same as an item at 0deg if inclusive.
                 * Leave this prop for angles other than 360deg unless otherwise desired.
                 * <AsteroidIcon />
                 * <EventIcon />
                 */
                rotationAngleInclusive={false}>
                <CircleMenuItem
                    onClick={this.props.onClickLoadAll}
                    tooltip="Event"
                    tooltipPlacement={TooltipPlacement.Right}>
                </CircleMenuItem>
                <CircleMenuItem
                    onClick={this.props.onClickLoadAsteroids}
                    tooltip="Asteroid"
                    tooltipPlacement={TooltipPlacement.Right}>
                </CircleMenuItem>
            </CircleMenu>
        )

        return (
            <div className="row mt-5 justify-content-center">
                {CircleMarkup}
            </div>
        )
    }


}

export default CirclesMenu;
